import React, { Component } from 'react'
import { Input, Menu, Segment } from 'semantic-ui-react'
import "./style.css";
import Logo from './beaubi_logo.png';

export default class MenuPointing extends Component {
  render() {
    return (
      <div class="header" style={{whitespace: 'nowrap'}}>
        <div class="header-cont">

          <img class="logo" src={Logo} alt='logo'width="150" height="60"/>

      </div>
      </div>
    )
  }
}
